import { ComponentType } from "react";

import Producten from "../Containers/InnovatieveProducten";
import Home from "../Containers/Home";
import AboutUs from "../Containers/AboutUs";

interface route {
    path: string;
    name: string;
    component: ComponentType;
}

const routes: route[] = [
    {
        path: '/',
        name: 'Home',
        component: Home
    },
    {
        path: '/over-ons',
        name: 'over-ons',
        component: AboutUs
    },
    {
        path: '/InnovatieveProducten',
        name: 'Producten',
        component: Producten
    }

];

export default routes;
